Plot:
&quot;Kali Topi Lal Rumal&quot; [1959] is an Indian Hindi film directed by Tara Harish. Starring Chandrashekhar, Shakila, Agha, KN Singh, Mukri and Kamal Mehra. Music is by Chitragupta. Lyrics by Majrooh Sultanpuri.

Its a story about a mans who loses his memory and then how his lady love helps him regain his memory.

The movie has some of the most melodious, superhit &amp; immortal gems. 

My Favs :
1. Lagi Choothe Na Ab To Sanam.... Lata ~ Rafi
2. Daga Daga Wai Wai Wai...Lata

All these gems are listed in the above poster.

